import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import GameHome from './components/GameHome';
import AWSArchitectureGame from './components/AWSArchitectureGame';
import CloudShooter from './components/CloudShooter';
import './styles/App.css';
import './styles/AWSArchitecture.css';

function App() {
  return (
    <Router>
        <div style={{ 
      position: 'relative',
      height: '100vh',
      isolation: 'isolate' // Creates a new stacking context
     }}></div>
      <Routes>
        <Route path="/" element={<GameHome />} />
        <Route path="/cloud-shooter" element={<CloudShooter />} />
        <Route path="/architecture-game" element={<AWSArchitectureGame />} />
      </Routes>
    </Router>
  );
}

export default App;
